import { useState } from 'react';

const ChangeText = () => {
    const [text, setText] = useState('FPTU');
    const [person, setPerson] = useState({'name': 'David', 'age': 20});

    const handleChangeText = () => {
        setText("Hello, it's me");
        setPerson({'name': 'Marry', 'age': 19})
    }
    return (
        <div>
            <h2>{text}</h2>
            <h1>Name: ${person.name} Age: ${person.age}</h1>
            <button onClick={handleChangeText}>Change</button>
        </div>
    );
}

export default ChangeText;
